import * as React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import ListSubheader from "@mui/material/ListSubheader";
import List from "@mui/material/List";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import SportsSoccerIcon from "@mui/icons-material/SportsSoccer";
import FlagIcon from "@mui/icons-material/Flag";
import LightbulbIcon from "@mui/icons-material/Lightbulb";
import IconButton from "@mui/material/IconButton";
import LockIcon from "@mui/icons-material/Lock";
import ListItem from "@mui/material/ListItem";

export function HintSection() {
  return (
    <div>
      <Card sx={{ mt: 5, mr: 5 }} variant="outlined">
        <CardContent>
          <List
            sx={{ bgcolor: "background.paper" }}
            component="nav"
            aria-labelledby="nested-list-subheader"
            subheader={
              <ListSubheader component="div" id="nested-list-subheader">
                Hints
              </ListSubheader>
            }
          >
            <ListItem
              secondaryAction={
                <IconButton edge="end" aria-label="comments">
                  <LockIcon />
                </IconButton>
              }
            >
              <ListItemIcon>
                <SportsSoccerIcon />
              </ListItemIcon>
              <ListItemText primary="Last Club of the player" />
            </ListItem>
            <ListItem
              secondaryAction={
                <IconButton edge="end" aria-label="comments">
                  <LockIcon />
                </IconButton>
              }
            >
              <ListItemIcon>
                <FlagIcon />
              </ListItemIcon>
              <ListItemText primary="Country of the player" />
            </ListItem>
            <ListItem
              secondaryAction={
                <IconButton edge="end" aria-label="comments" onClick={onClick}>
                  <LockIcon />
                </IconButton>
              }
            >
              <ListItemIcon>
                <LightbulbIcon />
              </ListItemIcon>
              <ListItemText primary="Surprise Hint" />
            </ListItem>
          </List>
        </CardContent>
      </Card>
    </div>
  );
}
